 const {perritos} = props;

  return (
   <div className={style.container}>
      { perritos?.map((character) => {
        return (
          <Card
               id={character.id}
              name={character.name}
              species={character.species}
              gender={character.gender}
              // origin={character.origin.name}
              status={character.status}
              image={character.image}             
